import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import { BsBriefcase } from "react-icons/bs";
import { AiOutlineCloud } from "react-icons/ai";
import { FaReact, FaFlask } from "react-icons/fa";
import { VerticalTimeline, VerticalTimelineElement }  from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
import Manhattan from "../../../assets/img/icons/Manhattan.png";
import styles from "assets/jss/material-kit-react/views/componentsSections/pillsStyle.js";

const useStyles = makeStyles(styles);

export default function ExperienceSection() {
  const classes = useStyles();
  return (
    <div style={{backgroundColor:"white"}} className={classes.section}>
      <div  className={classes.container}>
        <div  id="navigation-pills">
          <div className={classes.title}>
            <h1 >Experience</h1>
            <hr  style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
          </div>
          <div >
          <h2 style={{paddingTop:"50px"}}>Check out my Linkedin:</h2>
          <div class="LI-profile-badge"  data-version="v1" data-size="large" data-locale="en_US" data-type="vertical" data-theme="light" data-vanity="tanishqsandhu"><a class="LI-simple-link" href='https://www.linkedin.com/in/tanishqsandhu?trk=profile-badge'>Tanishq Sandhu</a></div>
          </div>
        </div>
      </div>
    </div>
  );
}
